import React, { Component } from 'react';
import './App.css';
import "bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import Routes from "./Routes";
import Navbar from "./Navbar";

class App extends Component{

  static defaultProps={
    menu:[
      {name: "home", icon: "home.svg", src: home}, //home
      {name: "text", icon: "text.svg", src: text},
      {name: "works", icon: "works.svg", src: works},
      {name: "about", icon: "text.svg", src: json},
      {name: "unsplash", icon: "text.svg", src: unsplash},
      {name: "monster", icon: "text.svg", src: monster},
      {name: "icon", icon: "text.svg", src: icon}
    ]
  }

  render(){
    return(
      <div className="App">
        <h1 className="display-1">
          Fernando Comet here
        </h1>
      </div>
    )
  }
}

export default App;
